import React from "react";
import { Link, useNavigate } from "react-router-dom";

const AdminNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    navigate("/admin/login");
  };

  return (
    <nav className="bg-blue-700 text-white p-4 flex justify-between">
      <h1 className="text-lg font-bold">Admin Panel</h1>
      <div>
        <Link to="/admin/dashboard" className="mr-4">
          Dashboard
        </Link>
        <Link to="/admin/courses" className="mr-4">
          Courses
        </Link>
        <Link to="/admin/instructors" className="mr-4">
          Instructors
        </Link>
        <button onClick={handleLogout} className="bg-red-600 px-2 py-1 rounded">
          Logout
        </button>
      </div>
    </nav>
  );
};

export default AdminNavbar;
